import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

import FooterLogo from '../../assets/instagram.svg'

const Banner = ({}: Props) => {
  return (
     <Styled.MainBanner> 
       <FooterLogo />
       <h1>asdas</h1>
     </Styled.MainBanner>
  ) 
};

export default Banner;
